import React, {useState, useEffect} from 'react'

function Counter() {

  const [count, setCount] = useState(0)
  return (
    <div>
        <button onClick={()=>setCount(count + 1)}>Increment</button>
        <h1>Hello This is a Component : {count}</h1>
    </div>
  )
}
export default Counter
